import React, { Component } from 'react'
import ReactApexChart from 'react-apexcharts'
import axios from "axios"



class DotaChart extends Component {
    
      state = {
        series: this.props.series.data,
        options: {
          chart: {
            id: 'realtime',
            height: 350,
            type: 'line',
            animations: {
              enabled: true,
              easing: 'linear',
              dynamicAnimation: {
                speed: 1000
              }
            },
            toolbar: {
              show: false
            },
            zoom: {
              enabled: false
            }
          },
          dataLabels: {
            enabled: false
          },
          stroke: {
            curve: 'smooth'
          },
          title: {
            text: 'Dynamic Updating Chart',
            align: 'left'
          },
          markers: {
            size: 0
          },
          xaxis: {
            // type: 'datetime',
            // categories: [1991,1992,1993,1994,1995,1996,1997, 1998,1999],
            // range: 10,
          },
          yaxis: {
            // max: 100
          },
          legend: {
            show: false
          },
        }, 
      };
    

    render() {
      console.log(this.props.series)
        return (
            <div id="chart">  
                <ReactApexChart options={this.state.options} series={this.state.series} type="line" height={350} />
            </div>
        )
    }
}
 
export default DotaChart
